import React, { useEffect } from "react";
import { Row } from "react-bootstrap";
import Header from "./Header";
import RoomCard from "./RoomCard";
import { getRooms } from "../../services";
import "../../App.css";

const YourRooms = () => {
  
  useEffect( async() =>{
    const data = await getRooms();
  });

  const rooms = [
    {
      roomNumber: "A101",
      name: "Ash",
      email: "ash@email.com",
      phone: "12345678",
      event: "Git and Github",
      date: "2021-01-21",
      duration: 2,
    },
    {
      roomNumber: "A102",
      name: "Ash",
      email: "ash@email.com",
      phone: "12345678",
      event: "Git and Github",
      date: "2021-01-21",
      duration: 2,
    },
  ];

  return (
    <>
      <Header />
      <div className="your-room-section">
        <h2>Your Rooms</h2>
        <Row>
          {rooms.map((room, i) => {
            return <RoomCard key={i} room={room} />;
          })}
        </Row>
      </div>
    </>
  );
};

export default YourRooms;
